import React from "react";

class Video extends React.Component {
  render() {
    return (
      <div class="container">
        <iframe
          title={this.props.title}
          width="625"
          height="352"
          src={this.props.videoUrl}
          frameborder="0"
          allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
          allowfullscreen=""
        ></iframe>
      </div>
    );
  }
}

export default Video;
